import Link from 'next/link'
import NavItem from './NavItem'
import styled from 'styled-components'



const NavLogo = () => (
  <div>
    <Link href="/">
      <a>Logo</a>
    </Link>
  </div>
)

const StyledNavBar = styled.nav`
  display: flex;
  justify-content: space-between;
  background-color: ${props => props.theme.white};
  position: fixed;
  top: 0px;
  left: 0px;
  z-index: 1;
  margin: 0;
  width: 100%;
  /* height: 7rem; */
  /* box-shadow: 0px 10px 13px -7px ${props => props.theme.grey}; */
  /* box-shadow: 0px -115px 41px 79px rgba(58,58,58,0.95); */
  /* box-shadow: 1px 1px 40px 0 rgba(0,0,0,.15); */
  /* box-shadow: 0px 10px 15px -3px rgba(0,0,0,0.1); large */
  box-shadow: 0px 4px 6px -1px rgba(0,0,0,0.1);

  ul {
    text-decoration: none;
    color: red;
    list-style: none;
    margin: 0;
    padding: 0;
    display: flex;
    font-size: 1.3rem;
  }
`

const StyledNavContainer = styled.div`
  margin: 0 3em;
`


const NavBar = () => (
  <StyledNavContainer>
    <StyledNavBar>
      <NavLogo />
      <ul>
        <NavItem route="/library" pageName="Library" />
        <NavItem route="/events" pageName="Events" />
        <NavItem route="/return-books" pageName="Return Books" />
        <NavItem route="/join" pageName="Sign Up" />
        <NavItem route="/admin" pageName="Admin" />
      </ul>
    </StyledNavBar>
  </StyledNavContainer>
)

export default NavBar
